window.addEventListener('message', (event) => {
  if (!event.data || !event.data.action) return;

  const { action } = event.data;

  if (action === 'play') {
    // Code to play the presentation
    startPresentation(); // Replace with the actual play function
  } else if (action === 'pause') {
    // Code to pause the presentation
    pausePresentation(); // Replace with the actual pause function
  }
});

function startPresentation() {
  console.log('Presentation started');
  // Add the logic to start the presentation
}

function pausePresentation() {
  console.log('Presentation paused');
  // Add the logic to pause the presentation
}
